    console.log(props.personnes)
    const style = {
        container : {
            border : "1px solid gray",
            borderRadius : 5,
            padding : 5,
            marginTop : 15,
            fontColor : "gray"
        }
    }

    return (
        <>
            <div style={style.container}>
                <h4>Nom : </h4>
                <h4>Prenom : </h4>
                <h4>Age : </h4>
                <h4>Genre : </h4>
            </div>
        </>
    )
}


export default ListePersonnel
